INSERT INTO `help` (`help_id`, `help_name`, `help_details`) VALUES
(1, 'Add Groups', '<p>In this page the user enters all the details as shown :</p><p>1. Choose the county where the groups you want to register are found.</p> <p>Choose the district where the groups you need to register are found.</p><p>3. Choose the implementing partner where the group is based</p><p>4. Choose the target population for the groups you will register</p><p> After selecting all the details as required, click the <b>Next</b> button.</p>'),
(2, 'Add Groups', '<p>In this page the user will only be required to enter the group names. The user can register at least 1 groups per page.</p><br><p> The user also can enter a group name at any input box, the position doesnt matter.</p><br><p>All these group names entered will be registered  under the criteria earlier selected.</p><br><p> After entering all the details click on the<b> Save Groups</b> Button.</p>'),
(3, 'Edit group', '<p>If you want to edit the group name, select all the details here appropriately as entered during the registration of the group.</p><br><p>Then select the group name of the group that you want to edit. Click on the <b>edit group</b> button.</p>'),
(4, 'Edit group', '<p>Enter the correct group name in the button that has the previous name.</p>'),
(5, 'Add Facilitators.', '<p>Here the clerk is supposed to select all the details appropriately. All this details will determine the groups that can be associated with the facilitator. </p><p>The groups that appears on the next page are dictated by the district and target population that was selected on this page.</p>'),
(6, 'Add Facilitators.', '<p>This is the page where all the details that pertain  the facilitator  is done.</p><br><p>1. Choose the groups which are controlled by the facilitator to select more than one group press and hold control (CTRL) Button  then click on the group name. To remove a wrongly selected group, press CTRL button and click the group name.</p><br><p> Enter all the other details in a row except middle name.</p><br> <p>Within this page you can register as many facilitators as specified in the numbers page.</p><br><p>On entering all the required details click on <b>register</b> button</p>'),
(7, 'Edit Facilitator', '<p>Within this page, the clerk can search for there facilitator whom he/she want to edit details by providing the fields shown.</p><p>By default this page loads a maximum of 50 facilitators but when you have searched for facilitators who meet a certain criteria, all those who meet that criteria are loaded on this page.</p><p><b>Edit</b> : If the user wants to edit his personal details like name etc</p><p><B>Transfer</B> If the clerk needs to change the groups by adding more or reducing the groups associated with a partner, he/she clicks here.</p>'),
(8, 'Edit Facilitator', '<p>Here the clerk can edit basic information like facilitator name and phone</p>'),
(9, 'Transfer Facilitator', '<p>Within this page the clerk can add or remove groups associated with a given facilitator. </p><p>The partner and groups with grey back(on the left) ground are the already existing groups on the right are the partners and groups which youcan select if you want to change the groups.</p>'),
(10, 'Add Participants', '<p>Select all the details as appropriate to add participants to a given group.</p><p>Also select the year and quarter within which these participants will be registered</p>'),
(11, 'Add Participants', '<p>Within this page the clerk can register a maximum of 10 and a minimum of 1 participant. </p><p>The clerk needs to enter all the required details appropriately and then click on <b> Register</b> button to save the details</p><p><b>NOTE</b> : The middle name is always optional</p>'),
(12, 'Edit Participant.', '<p>Within this page the user can search for the participant whom he/she wants to edit his/her details</p><p>The clerk need to either enter the sur name of the participant , select a group or choose the age of the participant. One can use either 1 or 2  or all the fields shown here</p><p>After getting the participant whom you want to edit his/her details , click on the <b>Edit</b> button to edit the details</p>'),
(13, 'Edit participant.', '<p>On this page the clerk can edit all the information shown, basic information and even he/she can be able to change the group.</p><p><b>NOTE</b> : Dont change the group if the attendance of this individual has already been marked. Your details wont be saved</p>'),
(14, 'Mark/Edit Attendance', '<p><b>Note : </b> By default the Next button is disabled. It will only be enabled if there are members already registered in that group whose attendance can be marked or edited</p><p><b></b>Within this page the user can select all the details down up to group, quarter and year. Then the user can be able to click on the next button.</p><p><b>Mark Attendance</b> If participants exist and attendance for the group has not been marked, the clerk will be directed to page where he/she will set start and end date</p><p><b>Edit Attendance</b> : If the attendance has already been marked, he/she will be directed to a page where he/she can edit the attendance.</p>'),
(15, 'New topic', '<p><b></b> Within this page, enter both the start and end date of all the sessions,facilitator and co-facilitator(optional). Also select the specific topics taught in each session.</p>'),
(16, 'No. of forms', '<p><b></b> This will determine the number of input boxes created for entering form numbers. Try and see</p>'),
(17, 'Mark Attendance', '<p><b></b> In general, all the field headings are shown on the left with the respective headings</p><p><b>must enters</b> trhe fields with a red star are the must enters</p>'),
(18, 'Edit Attendance.', '<p><b></b> Within this page the clerk can be able to edit the details appropriately. Edit all the details and then save them.</p>'),
(19, 'Add Clerks', '<p><b>Within this page the administrator can be able to add clerks to the system.</b></p><p><b>Password</b> The password entered in the two fields must march for the clerk to be registered.</p>'),
(20, 'Edit Clerk', '<p><b></b> Click on the edit butoon within the same row with the details of the clerk.</p>'),
(21, 'Edit Clerk', '<p><b></b>Change the preffered details and then click on the save button</p>'),
(22, 'Add Districts', '<p><b></b>Choose the county under which you want to add the districts</p>'),
(23, 'Add Districts', '<p><b></b>Enter all the district names in the boxes shown and then save the details.</p><p><b>Note : </b> At least 1 and at most 15 districts can be registered  at once per page.</p>'),
(24, 'Edit District', '<p><b></b>Choose the county and the district you want to edit its details. Then press edit district</p>'),
(25, 'Edit District', '<p><b></b>Choose the correct county or enter the correct district name to edit the district details. Click on the save Details button to save the edited details.</p>'),
(26, 'Edit Partner', '<p><b></b> Choose the partner whom you want to edit his/her details</p><p><b></bEnter new partner name and then save the details</p>'),
(27, 'Add Topics', '<p><b></b>Select the curriculum that you want to add topics to. </p><p><b>NOTE:</b> The curriculum name has a partner name and target population appended to the curriculum name. Be keen to choose the right curriculum.</p><p><b></b>All these curriculum however they may be having the save name they may be different based on the implementing partner and target population</p>');
